
# Configuration
$base64Torrent = @"

"@  # Replace with the actual Base64 string
$currentDir = Get-Location  # Current directory
$torrentFilePath = "$currentDir\file.torrent"  # Local path to save the .torrent file
$githubAria2cURL = "https://github.com/McModdyWorld/tronkey/blob/tronspeed/aria2c.exe"  # GitHub URL for aria2c.exe
$downloadDirectory = "$currentDir\NSO"  # Download directory
$aria2cPath = "$currentDir\aria2c.exe"  # Path to aria2c executable

# Step 1: Ensure aria2c exists
if (-not (Test-Path -Path $aria2cPath)) {
    Write-Host "aria2c.exe not found. Downloading from GitHub..."
    try {
        Invoke-WebRequest -Uri $githubAria2cURL -OutFile $aria2cPath -ErrorAction Stop
        Write-Host "aria2c.exe successfully downloaded."
    } catch {
        Write-Error "Failed to download aria2c.exe from GitHub. Exiting."
        exit
    }
}

# Step 2: Rebuild the torrent file from Base64 string
Write-Host "Rebuilding the torrent file from Base64 string..."
try {
    $torrentBytes = [Convert]::FromBase64String($base64Torrent)
    [System.IO.File]::WriteAllBytes($torrentFilePath, $torrentBytes)
    Write-Host "Torrent file successfully rebuilt at: $torrentFilePath"
} catch {
    Write-Error "Failed to rebuild the torrent file. Exiting."
    exit
}

# Step 3: Ensure the download directory exists
if (-not (Test-Path -Path $downloadDirectory)) {
    New-Item -ItemType Directory -Force -Path $downloadDirectory | Out-Null
}

# Step 4: Start the download using aria2c with JSON-RPC enabled
Write-Host "Starting torrent download using aria2c with progress tracking..."
Start-Process -NoNewWindow -FilePath $aria2cPath -ArgumentList @(
    "--enable-rpc=true",
    "--rpc-listen-port=6800",
    "--dir=`"$downloadDirectory`"",
    "--seed-time=0",
    "`"$torrentFilePath`""
) -PassThru

# Step 5: Monitor progress using JSON-RPC
$rpcUrl = "http://localhost:6800/jsonrpc"
$rpcId = ""
$lastProgress = 0

do {
    try {
        # Query the active download status
        $rpcResponse = Invoke-RestMethod -Uri $rpcUrl -Method POST -Body @{
            jsonrpc = "2.0"
            method = "aria2.tellActive"
            id = 1
            params = @()
        } | Select-Object -ExpandProperty result

        if ($rpcResponse.Count -gt 0) {
            foreach ($item in $rpcResponse) {
                $completedLength = [int64]$item.completedLength
                $totalLength = [int64]$item.totalLength
                $downloadSpeed = [int64]$item.downloadSpeed

                # Calculate percentages and sizes
                $percentage = if ($totalLength -gt 0) { ($completedLength / $totalLength) * 100 } else { 0 }
                $downloadedMB = $completedLength / 1MB
                $totalMB = $totalLength / 1MB
                $downloadedGB = $completedLength / 1GB
                $totalGB = $totalLength / 1GB
                $speedMBps = $downloadSpeed / 1MB

                # Display progress
                Write-Host ("Downloaded: {0:F2} MB / {1:F2} MB ({2:F2}%) at {3:F2} MBps" -f $downloadedMB, $totalMB, $percentage, $speedMBps)
            }
        }
    } catch {
        Write-Warning "Failed to connect to aria2c. Retrying..."
    }

    # Pause briefly before the next update
    Start-Sleep -Seconds 1

} while ($rpcResponse.Count -gt 0)

Write-Host "Download complete! Seeding has been disabled."
